import React, {Component} from 'react';

class Counter extends Component {
    render() {
        return (
            <div className="jumbotron">
                <h2>0</h2>
                <button className="btn btn-primary btn-lg">+</button>
                <button className="btn btn-primary btn-lg">-</button>
            </div>
        );
    }
}

export default Counter;
